import Link from 'next/link';
import logo from './logo.jpg';
const linkStyle = {
  marginRight: 500,
};

const Header = () => (
  <div>
    <h2>LETIŠTĚ CHRAST</h2>
    <img src ={require('./logo.jpg')}/>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
  </div>
   
);

export default Header;
